import React from 'react';
import { Link } from 'react-router-dom';
import './inicio.css'

export function Inicio() {
    return (
      <div className='IniCointainter'>
          <div className='textIni'>
              <span>dogapp</span><br/>
          </div>
          <div className='dogIni'>
             <img  src='https://i.stack.imgur.com/CYkWB.png' width="1200" height="100%" alt="" />
          </div>   
          <div className='dogInii'>
             <img  src='https://i.pinimg.com/originals/27/d6/33/27d6332add97c24febd69753b55b7f10.png' alt="" />
          </div>   
          <Link to= '/home'>
              <button className='btnIni'>Join</button>
          </Link>  
      </div>
    )
  };
